import { useState, useEffect } from "react";

export interface Colors {
    id: number;
    title: string;
    userName: string;
    numViews: number;
    numVotes: number;
    numComments: number;
    numHearts: number;
    rank: number;
    dateCreated: string;
    hex: string;
    rgb: Rgb;
    hsv: Hsv;
    description: string;
    url: string;
    imageUrl: string;
    badgeUrl: string;
    apiUrl: string;
}
export interface Rgb {
    red: number;
    green: number;
    blue: number;
}
export interface Hsv {
    hue: number;
    saturation: number;
    value: number;
}

const URL = 'http://localhost:8080/colors';

function FetchData() {

    const [data, setData] = useState<Colors[]>([]);

    useEffect(() => {

        const fetchData = async () => {

            const res = await fetch(URL);
            const result: Colors[] = await res.json();
            console.log(result);
            setData(result);
        }
        fetchData();
    }, []);

    return (
        <div>
            <table border={1}>
                <thead>
                    <th>ID</th>
                    <th>Title</th>
                    <th>UserName</th>
                </thead>
            </table>


            {data.length > 0 ? (
                data.map(color => (
                    <div key={color.id}>
                        <h2>{color.title}</h2>
                        <p>{color.description}</p>
                        <p>Created by: {color.userName}</p>
                        <p>Views: {color.numViews}</p>
                        <p>Votes: {color.numVotes}</p>
                        <p>Comments: {color.numComments}</p>
                        <p>Hearts: {color.numHearts}</p>
                        <p>Rank: {color.rank}</p>
                        <p>Date Created: {color.dateCreated}</p>
                        <p>Hex: {color.hex}</p>
                        <p>RGB: {`rgb(${color.rgb.red}, ${color.rgb.green}, ${color.rgb.blue})`}</p>
                        <p>HSV: {`hue: ${color.hsv.hue}, saturation: ${color.hsv.saturation}, value: ${color.hsv.value}`}</p>
                        <a href={color.url}>More Info</a>
                        <img src={color.imageUrl} alt={color.title} />
                    </div>
                ))
            ) : (
                <div>No data available</div>
            )}
        </div>
    );
}

export default FetchData;
